<template>
  <div class="weatherContainer">
    <view :class="weatherBoxBg">
        <view class="adress">
            <view><view class="iconfont icondingwei"></view>{{ city }}</view>
        </view>
        <view class="temperature">{{realtime.temperature}}℃</view>
        <view class="info">
            {{realtime.info}}
            <view style="margin:0 20rpx;">|</view>
            <view :class="airBoxBg">
                <view class="iconfont iconapp_icons--"></view>
                空气：{{realtime.aqi}} {{airQ}}
            </view>
        </view>
        <view class="info">
            <view class="iconfont iconzuobiao"></view>
            {{realtime.direct}}{{realtime.power}}
            <view class="iconfont iconwater_icon" style="margin-left:20rpx;"></view>
            {{realtime.humidity}}%
        </view>
    </view>
    <view class="futureTitle">未来5天</view>
    <ul class="futureBox">
        <li v-for="(item,index) of weatherClass" :key="index" class="futureItem">
            <p class="futureDay">{{ item.date }}</p>
            <p class="futureWeather">{{ item.weather }}</p>
            <p class="futureIcon"><i :class="item.icon"></i></p>
            <p class="futureTemp">{{ item.temperature }}</p>
            <p class="futureFeng">{{ item.direct }}</p>
        </li>
    </ul>
  </div>
</template>
<script>
import store from './store'
import URL from '../../utils/index'
export default {
    data () {
        return {
        
        }
    },

    computed:{
        city(){
            return store.state.city
        },
        weatherBoxBg(){
            return store.state.weatherBoxBg
        },
        airBoxBg(){
            return store.state.airBoxBg
        },
        airQ(){
            return store.state.airQ
        },
        realtime(){
            return store.state.realtime
        },
        weatherIcon(){
            return store.state.weatherIcon
        },
        weatherClass(){
            return store.state.weatherClass
        }
    },

    methods:{

        // 天气背景图片
        changeWeatherBgFn(info){
            switch (info) {
                case "阴":
                    store.commit("changeWeatherBg","duoyun-bg")
                    break;
                case "多云":
                    store.commit("changeWeatherBg","duoyun-bg")
                    break;
                case "多云转阴":
                    store.commit("changeWeatherBg","duoyun-bg")
                    break;
                case "多云转晴":
                    store.commit("changeWeatherBg","duoyun-bg")
                    break;
                case "多云转小雨":
                    store.commit("changeWeatherBg","duoyun-bg")
                    break;
                case "小雨转多云":
                    store.commit("changeWeatherBg","xiaoyu-bg")
                    break;
                case "小雨转中雨":
                    store.commit("changeWeatherBg","xiaoyu-bg")
                    break;
                case "阴转小雨":
                    store.commit("changeWeatherBg","xiaoyu-bg")
                    break;
                case "小雨":
                    store.commit("changeWeatherBg","xiaoyu-bg")
                    break;
                case "中雨":
                    store.commit("changeWeatherBg","xiaoyu-bg")
                    break;
                case "雷阵雨":
                    store.commit("changeWeatherBg","xiaoyu-bg")
                    break;
                case "多云转雷阵雨":
                    store.commit("changeWeatherBg","xiaoyu-bg")
                    break;
                case "晴":
                    store.commit("changeWeatherBg","qing-bg")
                    break;
                case "晴转多云":
                    store.commit("changeWeatherBg","qing-bg")
                    break;
                case "小雪":
                    store.commit("changeWeatherBg","snow-bg")
                    break;
                case "中雪":
                    store.commit("changeWeatherBg","snow-bg")
                    break;
                case "阵雪":
                    store.commit("changeWeatherBg","snow-bg")
                    break;
                case "多云转小雪":
                    store.commit("changeWeatherBg","snow-bg")
                    break;
                case "小雪转阴":
                    store.commit("changeWeatherBg","snow-bg")
                    break;
                case "小雪转阵雪":
                    store.commit("changeWeatherBg","snow-bg")
                    break;
            }
        },

        // 空气质量
        changeAqiFn(airAqi){
            if (airAqi > 0 && airAqi <= 50) {
                store.commit("changeAirBg","airGreen-bg")
                store.commit("changeAirQ","优")
            } else if (airAqi > 50 && airAqi <= 100) {
                store.commit("changeAirBg","airBlue-bg")
                store.commit("changeAirQ","良")
            } else if (airAqi > 100 && airAqi <= 150) {
                store.commit("changeAirBg","airOrange-bg")
                store.commit("changeAirQ","中")
            } else if (airAqi > 150 && airAqi <= 200) {
                store.commit("changeAirBg","airRed-bg")
                store.commit("changeAirQ","差")
            } else if (airAqi > 200 && airAqi <= 300) {
                store.commit("changeAirBg","airGray-bg")
                store.commit("changeAirQ","极差")
            } else if (airAqi > 300) {
                store.commit("changeAirBg","airBlack-bg")
                store.commit("changeAirQ","逃")
            }
        },

        // 未来5天天气图标
        changeWeatherIconFn(weather){
            switch (weather) {
                case "阴":
                    store.commit("changeWeatherIcon","iconfont icontianqi-yintian")
                    break;
                case "多云":
                    store.commit("changeWeatherIcon","iconfont iconduoyun")
                    break;
                case "多云转阴":
                    store.commit("changeWeatherIcon","iconfont iconduoyun")
                    break;
                case "多云转晴":
                    store.commit("changeWeatherIcon","iconfont iconduoyun")
                    break;
                case "多云转小雨":
                    store.commit("changeWeatherIcon","iconfont iconn-xiaoyu")
                    break;
                case "小雨转多云":
                    store.commit("changeWeatherIcon","iconfont iconn-xiaoyu")
                    break;
                case "小雨转中雨":
                    store.commit("changeWeatherIcon","iconfont iconn-xiaoyu")
                    break;
                case "阴转小雨":
                    store.commit("changeWeatherIcon","iconfont iconn-xiaoyu")
                    break;
                case "小雨":
                    store.commit("changeWeatherIcon","iconfont iconn-xiaoyu")
                    break;
                case "中雨":
                    store.commit("changeWeatherIcon","iconfont iconn-xiaoyu")
                    break;
                case "雷阵雨":
                    store.commit("changeWeatherIcon","iconfont iconn-xiaoyu")
                    break;
                case "多云转雷阵雨":
                    store.commit("changeWeatherIcon","iconfont iconn-xiaoyu")
                    break;
                case "晴":
                    store.commit("changeWeatherIcon","iconfont iconqingtian")
                    break;
                case "晴转多云":
                    store.commit("changeWeatherIcon","iconfont iconqingtian")
                    break;
                case "小雪":
                    store.commit("changeWeatherIcon","iconfont iconxue")
                    break;
                case "中雪":
                    store.commit("changeWeatherIcon","iconfont iconxue")
                    break;
                case "阵雪":
                    store.commit("changeWeatherIcon","iconfont iconxue")
                    break;
                case "多云转小雪":
                    store.commit("changeWeatherIcon","iconfont iconxue")
                    break;
                case "小雪转阴":
                    store.commit("changeWeatherIcon","iconfont iconxue")
                    break;
                case "小雪转阵雪":
                    store.commit("changeWeatherIcon","iconfont iconxue")
                    break;
            }
        }

    },

    mounted(){
        // console.log(URL.xingwl)
        let that = this
            //腾讯地图KEY： VINBZ-4E4CI-UUNGF-5U32E-66JDO-6RB66
        wx.getLocation({
            type: 'wgs84',
            success(res) {
                store.commit("changeLatitude",res.latitude)
                store.commit("changeLongitude",res.longitude)
                let location=res.latitude+ "," + res.longitude
                console.log(res.latitude,res.longitude)
                wx.request({
                    // url: "https://apis.map.qq.com/ws/geocoder/v1/?location=" + location + "&key=VINBZ-4E4CI-UUNGF-5U32E-66JDO-6RB66",
                    url: URL.xingwl+"api/small/map?location=" + location + "&key=VINBZ-4E4CI-UUNGF-5U32E-66JDO-6RB66",
                    success(resCity) {
                        console.log(resCity)
                        let city = resCity.data.result.address_component.city
                        city = city.slice(0, city.indexOf("市"))
                        wx.request({
                            // url: "http://apis.juhe.cn/simpleWeather/query?city=" + city + "&key=8428907322fc2a06bb0ecc8d8469e5f9",
                            url: URL.xingwl+"api/small/weather?city=" + city + "&key=8428907322fc2a06bb0ecc8d8469e5f9",
                            success(weatherData) {
                                // 天气背景图片
                                that.changeWeatherBgFn(weatherData.data.result.realtime.info)
                                // 空气质量标准
                                let airAqi = weatherData.data.result.realtime.aqi * 1;
                                that.changeAqiFn(airAqi)

                                store.commit("changeCity",weatherData.data.result.city)
                                store.commit("changeRealtime",weatherData.data.result.realtime)
                                store.commit("changeWeatherBoxBg",store.state.weatherBoxBg+' '+store.state.weatherBg)
                                store.commit("changeAirBoxBg",store.state.airBoxBg+' '+store.state.airBg)

                                // 未来5天的天气
                                store.commit("changeFuture",weatherData.data.result.future)

                                let weatherClassArr=[]
                                weatherData.data.result.future.map((item, index) => {
                                    let obj = item
                                    let dateDay=item.date
                                    let newArr=dateDay.split("-")
                                    newArr.shift()
                                    let dateString=newArr.join("/")
                                    obj.date=dateString
                                    that.changeWeatherIconFn(item.weather)
                                    obj.icon = store.state.weatherIcon
                                    weatherClassArr.push(obj)
                                })
                                store.commit('changeWeatherClass',weatherClassArr)

                            }
                        })
                    }
                })
            }
        })
    }



}
</script>

<style lang="scss">
