    overflow: hidden;
  width: 100%;
  .weatherBox {
      width: 100%;
      height: 600rpx;
      display: flex;
      flex-direction: column;
      justify-content: space-around;
      align-items: center;
      margin: 0 0 40rpx;
      .adress {
          text-align: center;
          view {
              display: inline-block;
          }
      }
      .temperature {
          color: #333;
          font-size: 240rpx;
          font-weight: 100;
          font-family: 'Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif;
      }
      .info {
          color: #333;
          view {
              display: inline-block;
          }
          .air {
              color: #fff;
              padding: 0 14rpx;
              border-radius: 10rpx;
          }
      }
  }

  .futureTitle {
      width: 100%;
      font-weight: 600;
      font-size: 36rpx;
      line-height: 70rpx;
      padding: 0 40rpx;
      border-bottom: 1px solid #ccc;
  }

  .futureBox {
    width: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    .futureItem {
        width: 100%;
        height: 120rpx;
        display: flex;
        align-items: center;
        p{
            text-align: center;
        }
        .futureDay{
            flex:1;
        }
        .futureWeather{
            flex:1;
        }
        .futureIcon{
            width:80rpx;
            height: 50rpx;
            font-size: 38rpx;
            
        }
        .futureTemp{
            flex:1;
        }
        .futureFeng{
            width:30%;
        }
    }
  }

  // 空气标准
  .airGreen-bg {
      background-color: #0E9739;
  }

  .airBlue-bg {
      background-color: #3385FF;
  }

  .airOrange-bg {
      background-color: #FEA03E;
  }

  .airRed-bg {
      background-color: #f00;
  }

  .airGray-bg {
      background-color: #ccc;
  }

  .airBlack-bg {
      background-color: #000;
  }
  // 天气情况
  .duoyun-bg {
      background: url('data:image/png;base64,') no-repeat center;
      background-size: cover;
  }

  .xiaoyu-bg {
      background: url('data:image/png;base64,') no-repeat center;
      background-size: cover;
  }

  .qing-bg {
      background: url('data:image/png;base64,') no-repeat center;
      background-size: cover;
  }

  .snow-bg{
    background: url('data:image/png;base64,') no-repeat center;
    background-size: cover;
  }
}
